/// <summary>
/// Finds <c>LedgerCurrencyParameters_RU</c> record by given record id
/// </summary>
/// <param name="_recId">
/// record id to look for
/// </param>
/// <param name="_forUpdate">
/// Should record be selected for update
/// </param>
/// <returns>
/// Found <c>LedgerCurrencyParameters_RU</c> record
/// </returns>
public static LedgerCurrencyParameters_RU find(RecId _recId, boolean _forUpdate = false)
{
    LedgerCurrencyParameters_RU ledgerCurrencyParameters;

    if (_recId)
    {
        if (_forUpdate)
        {
            ledgerCurrencyParameters.selectForUpdate(_forUpdate);
        }

        select firstonly ledgerCurrencyParameters
            where ledgerCurrencyParameters.RecId == _recId;
    }

    return ledgerCurrencyParameters;
}

/// <summary>
/// Finds <c>LedgerCurrencyParameters_RU</c> record by given currency code and ledger
/// </summary>
/// <param name="_ledger">
/// Record id of <c>Ledger</c>
/// </param>
/// <param name="_currencyCode">
/// Currency code to look for
/// </param>
/// <param name="_forUpdate">
/// Should record be selected for update
/// </param>
/// <returns>
/// Found <c>LedgerCurrencyParameters_RU</c> record
/// </returns>
public static LedgerCurrencyParameters_RU findCurrencyCode(LedgerRecId _ledger, CurrencyCode _currencyCode, boolean _forUpdate = false)
{
    LedgerCurrencyParameters_RU ledgerCurrencyParameters;

    if (_ledger)
    {
        if (_forUpdate)
        {
            ledgerCurrencyParameters.selectForUpdate(_forUpdate);
        }

        select firstonly ledgerCurrencyParameters
            where ledgerCurrencyParameters.CurrencyCode == _currencyCode
               && ledgerCurrencyParameters.Ledger       == _ledger;
    }

    return ledgerCurrencyParameters;
}

/// <summary>
/// Finds <c>LedgerCurrencyParameters_RU</c> record by given ledger
/// </summary>
/// <param name="_ledger">
/// Record id of <c>Ledger</c>
/// </param>
/// <param name="_forUpdate">
/// Should record be selected for update
/// </param>
/// <returns>
/// Found <c>LedgerCurrencyParameters_RU</c> record
/// </returns>
public static LedgerCurrencyParameters_RU findLedger(LedgerRecId _ledger, boolean _forUpdate = false)
{
    LedgerCurrencyParameters_RU ledgerCurrencyParameters;

    if (_ledger)
    {
        if (_forUpdate)
        {
            ledgerCurrencyParameters.selectForUpdate(_forUpdate);
        }

        select firstonly ledgerCurrencyParameters
            where ledgerCurrencyParameters.Ledger       == _ledger
               && ledgerCurrencyParameters.CurrencyCode == '';
    }

    return ledgerCurrencyParameters;
}

/// <summary>
/// Finds or creates <c>LedgerCurrencyParameters_RU</c> record for given ledger
/// </summary>
/// <param name="_ledger">
/// Record id of <c>Ledger</c>
/// </param>
/// <returns>
/// Found or created <c>LedgerCurrencyParameters_RU</c> record
/// </returns>
public static LedgerCurrencyParameters_RU findOrCreateLedger(LedgerRecId _ledger)
{
    LedgerCurrencyParameters_RU ledgerCurrencyParameters;

    if (_ledger)
    {
        select firstonly forUpdate ledgerCurrencyParameters
            where ledgerCurrencyParameters.Ledger       == _ledger
               && ledgerCurrencyParameters.CurrencyCode == '';

        if (!ledgerCurrencyParameters)
        {
            ledgerCurrencyParameters.Ledger = _ledger;
            ledgerCurrencyParameters.insert();
        }
    }

    return ledgerCurrencyParameters;
}

/// <summary>
/// Finds <c>LedgerCurrencyParameters_RU</c> record by given ledger and currency code
/// </summary>
/// <param name="_ledger">
/// Record id of <c>Ledger</c>
/// </param>
/// <param name="_currencyCode">
/// Currency code to look for
/// </param>
/// <param name="_forupdate">
/// Should record be selected for update
/// </param>
/// <returns>
/// Found <c>LedgerCurrencyParameters_RU</c> record
/// </returns>
public static LedgerCurrencyParameters_RU findParameters(LedgerRecId _ledger, CurrencyCode _currencyCode, boolean _forupdate = false)
{
    LedgerCurrencyParameters_RU ledgerCurrencyParameters;

    if (_ledger)
    {
        if (_currencyCode)
        {
            ledgerCurrencyParameters = LedgerCurrencyParameters_RU::findCurrencyCode(_ledger, _currencyCode, _forupdate);
        }

        if (!ledgerCurrencyParameters)
        {
            ledgerCurrencyParameters = LedgerCurrencyParameters_RU::findLedger(_ledger, _forupdate);
        }
    }

    return ledgerCurrencyParameters;
}

/// <summary>
/// Creates setup of <c>LedgerCurrencyParameters_RU</c> when switching between extended setup
/// </summary>
/// <param name="_extendedSetup">
/// Should record be extended setup
/// </param>
static void updateExchRateDiffExtendedSetup(NoYes _extendedSetup)
{
    RecId                       currentLedger = Ledger::current();
    LedgerCurrencyParameters_RU ledgerCurrencyParameters = LedgerCurrencyParameters_RU::findLedger(currentLedger, true);

    ttsBegin;
    while select forupdate ledgerCurrencyParameters
        where ledgerCurrencyParameters.Ledger == currentLedger
    {
        if (_extendedSetup)
        {
            // customers
            ledgerCurrencyParameters.CustPostingMode                        = CustVendAmountDiffPostingMode_RU::SpecialPosting;

            ledgerCurrencyParameters.RealizedLossCustLedgerDimension        = CurrencyLedgerGainLossAccount::ledgerDimension(
                                                                                currentLedger,
                                                                                ledgerCurrencyParameters.CurrencyCode,
                                                                                CurrencyGainLossAccountType::RealizedLoss);

            ledgerCurrencyParameters.RealizedProfitCustLedgerDimension      = CurrencyLedgerGainLossAccount::ledgerDimension(
                                                                                currentLedger,
                                                                                ledgerCurrencyParameters.CurrencyCode,
                                                                                CurrencyGainLossAccountType::RealizedGain);

            ledgerCurrencyParameters.UnrealizedLossCustLedgerDimension      = CurrencyLedgerGainLossAccount::ledgerDimension(
                                                                                currentLedger,
                                                                                ledgerCurrencyParameters.CurrencyCode,
                                                                                CurrencyGainLossAccountType::UnrealizedLoss);

            ledgerCurrencyParameters.UnrealizedProfitCustLedgerDimension    = CurrencyLedgerGainLossAccount::ledgerDimension(
                                                                                currentLedger,
                                                                                ledgerCurrencyParameters.CurrencyCode,
                                                                                CurrencyGainLossAccountType::UnrealizedGain);

            ledgerCurrencyParameters.ExchRateLossTaxVend                    = ledgerCurrencyParameters.ExchRateNeg;
            ledgerCurrencyParameters.ExchRateProfitTaxVend                  = ledgerCurrencyParameters.ExchRatePos;

            ledgerCurrencyParameters.RTax25ProfitTableLossCust              = ledgerCurrencyParameters.RTax25ProfitTableLoss;
            ledgerCurrencyParameters.RTax25ProfitTableProfitCust            = ledgerCurrencyParameters.RTax25ProfitTableProfit;

            // vendors
            ledgerCurrencyParameters.VendPostingMode                        = CustVendAmountDiffPostingMode_RU::SpecialPosting;

            ledgerCurrencyParameters.RealizedLossVendLedgerDimension        = ledgerCurrencyParameters.RealizedLossCustLedgerDimension;
            ledgerCurrencyParameters.RealizedProfitVendLedgerDimension      = ledgerCurrencyParameters.RealizedProfitCustLedgerDimension;
            ledgerCurrencyParameters.UnrealizedLossVendLedgerDimension      = ledgerCurrencyParameters.UnrealizedLossCustLedgerDimension;
            ledgerCurrencyParameters.UnrealizedProfitVendLedgerDimension    = ledgerCurrencyParameters.UnrealizedProfitCustLedgerDimension;

            ledgerCurrencyParameters.ExchRateLossTaxVend                    = ledgerCurrencyParameters.ExchRateNeg;
            ledgerCurrencyParameters.ExchRateProfitTaxVend                  = ledgerCurrencyParameters.ExchRatePos;

            ledgerCurrencyParameters.RTax25ProfitTableLossVend              = ledgerCurrencyParameters.RTax25ProfitTableLoss;
            ledgerCurrencyParameters.RTax25ProfitTableProfitVend            = ledgerCurrencyParameters.RTax25ProfitTableProfit;

            // employees
            ledgerCurrencyParameters.RealizedProfitEmplLedgerDimension      = ledgerCurrencyParameters.RealizedProfitCustLedgerDimension;
            ledgerCurrencyParameters.RealizedLossEmplLedgerDimension        = ledgerCurrencyParameters.RealizedLossCustLedgerDimension;
            ledgerCurrencyParameters.UnrealizedProfitEmplLedgerDimension    = ledgerCurrencyParameters.UnrealizedProfitCustLedgerDimension;
            ledgerCurrencyParameters.UnrealizedLossEmplLedgerDimension      = ledgerCurrencyParameters.UnrealizedLossCustLedgerDimension;

            ledgerCurrencyParameters.RTax25ProfitTableProfitEmpl            = ledgerCurrencyParameters.RTax25ProfitTableProfit;
            ledgerCurrencyParameters.RTax25ProfitTableLossEmpl              = ledgerCurrencyParameters.RTax25ProfitTableLoss;
        }
        else
        {
            ledgerCurrencyParameters.TaxAmountDiffLedgerDimension           = 0;

            // customers
            ledgerCurrencyParameters.RealizedLossCustLedgerDimension        = 0;
            ledgerCurrencyParameters.RealizedProfitCustLedgerDimension      = 0;
            ledgerCurrencyParameters.UnrealizedLossCustLedgerDimension      = 0;
            ledgerCurrencyParameters.UnrealizedProfitCustLedgerDimension    = 0;

            ledgerCurrencyParameters.ExchRateNonrealProfitTaxCust           = ExchAdjTaxableType_W::No;
            ledgerCurrencyParameters.ExchRateNonrealLossTaxCust             = ExchAdjTaxableType_W::No;

            ledgerCurrencyParameters.RealizedLossTaxCustLedgerDimension     = 0;
            ledgerCurrencyParameters.RealizedProfitTaxCustLedgerDimension   = 0;
            ledgerCurrencyParameters.UnrealizedLossTaxCustLedgerDimension   = 0;
            ledgerCurrencyParameters.UnrealizedProfitTaxCustLedgerDimension = 0;

            ledgerCurrencyParameters.RTax25ProfitTableProfitCust            = 0;
            ledgerCurrencyParameters.RTax25ProfitTableLossCust              = 0;

            ledgerCurrencyParameters.CustPostingMode                        = CustVendAmountDiffPostingMode_RU::SpecialPosting;
            ledgerCurrencyParameters.CustPostingModeTax                     = CustVendAmountDiffPostingMode_RU::InvoicePosting;

            // vendors
            ledgerCurrencyParameters.RealizedLossVendLedgerDimension        = 0;
            ledgerCurrencyParameters.RealizedProfitVendLedgerDimension      = 0;
            ledgerCurrencyParameters.UnrealizedLossVendLedgerDimension      = 0;
            ledgerCurrencyParameters.UnrealizedProfitVendLedgerDimension    = 0;

            ledgerCurrencyParameters.RealizedLossTaxVendLedgerDimension     = 0;
            ledgerCurrencyParameters.RealizedProfitTaxVendLedgerDimension   = 0;

            ledgerCurrencyParameters.ExchRateProfitTaxVend                  = ExchAdjTaxableType_W::No;
            ledgerCurrencyParameters.ExchRateLossTaxVend                    = ExchAdjTaxableType_W::No;

            ledgerCurrencyParameters.RTax25ProfitTableProfitVend            = 0;
            ledgerCurrencyParameters.RTax25ProfitTableLossVend              = 0;

            ledgerCurrencyParameters.VendPostingMode                        = CustVendAmountDiffPostingMode_RU::SpecialPosting;
            ledgerCurrencyParameters.VendPostingModeTax                     = CustVendAmountDiffPostingMode_RU::InvoicePosting;

            // employees
            ledgerCurrencyParameters.RealizedProfitEmplLedgerDimension      = 0;
            ledgerCurrencyParameters.RealizedLossEmplLedgerDimension        = 0;
            ledgerCurrencyParameters.UnrealizedProfitEmplLedgerDimension    = 0;
            ledgerCurrencyParameters.UnrealizedLossEmplLedgerDimension      = 0;

            ledgerCurrencyParameters.RTax25ProfitTableProfitEmpl            = 0;
            ledgerCurrencyParameters.RTax25ProfitTableLossEmpl              = 0;
        }

        ledgerCurrencyParameters.update();
    }
    ttsCommit;
}

/// <summary>
/// Updates field values for <c>LedgerCurrencyParameters_RU</c> record
/// </summary>
/// <param name="_ledger">
/// Record id of <c>Ledger</c>
/// </param>
/// <param name="_currencyCode">
/// Currency code to look for
/// </param>
/// <param name="_fieldId">
/// Id of fiel do be updated
/// </param>
/// <param name="_value">
/// <c>LedgerDimensionDefaultAccount</c> value for update
/// </param>
/// <param name="_exchAdjTaxableFieldId">
/// Taxable field id to be updates
/// </param>
/// <param name="_exchAdjTaxablealue">
/// <c>ExchAdjTaxableType_W</c> value for update
/// </param>
/// <exception cref="Exception::Error">
/// If field not found by given id
/// </exception>
/// <exception cref="Exception::Error">
/// If taxable field not found by given id
/// </exception>
public static void updateLedgerDimensionValue(
    LedgerRecId                     _ledger,
    CurrencyCode                    _currencyCode,
    FieldId                         _fieldId,
    LedgerDimensionDefaultAccount   _value,
    FieldId                         _exchAdjTaxableFieldId  = 0,
    ExchAdjTaxableType_W            _exchAdjTaxablealue     = ExchAdjTaxableType_W::No)
{
    LedgerCurrencyParameters_RU ledgerCurrencyParameters;

    if (!SysDictField::findFieldById(ledgerCurrencyParameters.TableId, _fieldId))
    {
        throw error(Error::wrongUseOfFunction(funcName()));
    }

    if (_exchAdjTaxableFieldId && !SysDictField::findFieldById(ledgerCurrencyParameters.TableId, _exchAdjTaxableFieldId))
    {
        throw error(Error::wrongUseOfFunction(funcName()));
    }

    ledgerCurrencyParameters                = LedgerCurrencyParameters_RU::findCurrencyCode(_ledger, _currencyCode, true);
    ledgerCurrencyParameters.Ledger         = _ledger;
    ledgerCurrencyParameters.CurrencyCode   = _currencyCode;
    ledgerCurrencyParameters.(_fieldId)     = _value;

    if (_exchAdjTaxableFieldId)
    {
        ledgerCurrencyParameters.(_exchAdjTaxableFieldId) = _exchAdjTaxablealue;
    }

    ledgerCurrencyParameters.write();
}
